import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import ThunderstormIcon from '@mui/icons-material/Thunderstorm';
import AcUnitIcon from '@mui/icons-material/AcUnit';
import WbSunnyIcon from '@mui/icons-material/WbSunny';
import "./InfoBox.css";

export default function InfoBox({info}){
    // console.log(cityInfo);
    return (
        <div className="InfoBox">
            <div className="cardContainer">
            <Card sx={{ maxWidth: 345 }}>
      <CardMedia
        sx={{ height: 140 }}
        image={info.humidity>80?"data:image/jpeg;base64,":info.temp>15?"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRQhAJCbvKq5MqdZh1fmKsWbZ6dwPdVrgvPdg&usqp=CAU":"data:image/jpeg;base64,"}
        title="green iguana"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          {info.city.replace(info.city[0], info.city[0].toUpperCase())} {info.humidity>80?<ThunderstormIcon/>:info.temp>15?<WbSunnyIcon/>:<AcUnitIcon/>}
        </Typography>
        <Typography variant="body2" color="text.secondary" component={"span"}>
          <p>Temperature= {info.temp}&deg;C</p>
          <p>Humidity = {info.humidity}</p>
          <p>Min Temp= {info.tempMin}&deg;C</p>
          <p>Max Temp= {info.tempMax}&deg;C</p>
          <p>The weather can be described as <i>{info.weather} </i> and feels like {info.feels_like}&deg;C</p>

          

        </Typography>
      </CardContent>
    </Card>
    </div>
        </div>
    );
}